import React from "react";

export default function Quienessomos()
{
    return(
        <div className="container md-5">
            <h2>Quienes</h2>           
                
                <p>
                Reserva de habitaciones es una pagina de reservacion de habitaciones con mas de 14 años de trayectoria en el mercado, 
                caracterizada por el buen servicio y oferta de productos turísticos de calidad 
                en destinos nacionales e internacionales, trabajando con un equipo de más de 
                60 personas comprometido con cumplir los sueños de viaje de nuestros clientes. 
                Coordinamos todos los servicios pertinentes al alquiler de de habitaciones
                </p>
            
        </div>
    )
};
